import React, { Component } from "react";
import { Button, Message } from "semantic-ui-react";
import Layout from "../../components/Layout";

class MailList extends Component {

  renderList() {
    const list = [
      '이름: ',
      '주소: ',
    ]


    return <Message header='받으시는분' list={list} style={{ maxWidth: "40em" }} />;
  }

  render() {
    return (
      <Layout>
        <div>
          <Button type="submit" basic color="violet" floated="right">
            택배 접수
          </Button>
        </div>
        <div>
          {this.renderList()}
        </div>
      </Layout>
    );
  }
}

export default MailList;
